import styles from "./MyPosts.module.css";
import Post from "./Post/Post";

const MyPosts = () => {

    let postData = [
        { id: 1, message: "hello" },
        { id: 2, message: "I's my first post!" },
        { id: 3, message: "Alf" },
        { id: 4, message: "Bean" },
        { id: 5, message: "Bill" },
    ];

    return (
        <div className={styles.posts}>
            <h3>My posts</h3>
            <div className={styles.formBlock}>
                <div>
                    {" "}
                    <textarea></textarea>
                </div>
                <div>
                    {" "}
                    <button className={styles.btn}>Add post</button>
                </div>
            </div>
            <div className={styles.block}>
                <Post message="hello!" like={15} />
                <Post message="I's my first post!" like={15} />
            </div>
        </div>
    );
};

export default MyPosts;
